The area of the region bounded by the curves $y=\sqrt{x}$, $y=1$, and $x=4$ is given by the integral of $y$ with respect to $x$ from $x=0$ to $x=4$.

\begin{align*}
\int_0^4 y \, dx &= \int_0^4 \sqrt{x} \, dx \\
&= \frac{2}{3}x^{3/2} \Big|_0^4 \\
&= \frac{2}{3} \left( \frac{4^{3/2}}{0^{3/2}} - \frac{0^{3/2}}{0^{3/2}} \right) \\
&= \frac{2}{3} \left( 4 - 0 \right) \\
&= \frac{2}{3} \cdot 4 \\
&= \frac{8}{3}
\end{align*}

So the area of the region is $\frac{8}{3}$.

